import React from 'react'

const TodoList = ({todos,handleDelete}) => {
    
  return (
    <div>
        {todos.map((item,index)=>(
            <>
            <p key={index}>{item}</p>
            <div >
            <button onClick={handleDelete} key={index}>Delete</button>
            <button>Edit</button>
            </div>
            </>
        ))}
        

    </div>
  )
}

export default TodoList
